							leverde inderdaad een verlies van € 25 op! </em></p>

					<p class="m-t-25"><em>Het voelde alsof mijn keel werd dichtgeknepen. Ik dacht dat ik was opgelicht. Ik stond
							zelfs op het punt om mijn persoonlijke investeerder te bellen en mijn geld terug te vragen. Maar toen
							herinnerde ik me wat hij me tijdens ons eerdere gesprek had verteld: <strong>het algoritme heeft het
								ongeveer in 80-89% van de gevallen bij</strong> het rechte eind. Niet ALLE transacties zullen winst
							opleveren, maar uiteindelijk zullen genoeg transacties winst opleveren om geld te verdienen. </em></p>

					<p class="m-t-25"><em>Daarom zorgde ik ervoor dat de software transacties voor me bleef uitvoeren en ik hield
							de transacties nauwlettend in de gaten. <strong>De volgende transactie leverde winst op!</strong> Het was
							een winst van slechts € 19, maar het was in ieder geval iets. De transactie die daarna werd uitgevoerd,
